import React from 'react';
import "./signup.scss";

const Signup = () => {
    return (
        <div className="containerSignup">
            <form className="item-form">
                <h1>Sign Up</h1>
                <div>
                    <input placeholder="Tên Tài Khoản"  />
                </div>
                <div>
                    <input placeholder="Tên Tài Khoản" />
                </div>
                <div>
                    <input placeholder="Mật Khẩu"  />
                </div>
            </form>
        </div>
    );
}

export default Signup;
